import { Routes } from 'react-router-dom';
import './App.css';
import Home from './Components/Home';
import UserDetail from './DetailPage/UserDetail';

function App() {
  return (
    <>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="userdetail" element={<UserDetail />} />
      </Routes>

      {/* <Home /> */}

    </>
  );
}

export default App;
